// UserDashboard.js

import React, { useState, useEffect } from 'react';

const UserDashboard = ({ userData }) => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [fetchedUserData, setFetchedUserData] = useState(null);

  useEffect(() => {
    const fetchUserById = async () => {
      if (userData) {
        try {
          setLoading(true);

          const response = await fetch(`/user/${userData.id}`, {
            method: 'GET',
            headers: {
              'Content-Type': 'application/json',
            },
          });

          if (response.ok) {
            const data = await response.json();
            console.log('User data from API:', data.user);
            setFetchedUserData(data.user); // Update the fetched user data
          } else {
            console.error('Error fetching user data. Status:', response.status);
            const errorMessage = await response.text();
            console.error('Error message:', errorMessage);
            setError(`Error fetching user data: ${errorMessage}`);
          }
        } catch (error) {
          console.error('Error fetching user:', error);
          setError('Something went wrong. Please try again.');
        } finally {
          setLoading(false);
        }
      }
    };

    fetchUserById();
  }, [userData]);

  useEffect(() => {
    // Log the fetchedUserData whenever it changes
    console.log('Updated fetchedUserData:', fetchedUserData);
  }, [fetchedUserData]);

  return (
    <div>
      <h1>User Dashboard</h1>
      {loading && <p>Fetching user data...</p>}
      {error && <p>{error}</p>}
      {fetchedUserData && (
        <div>
          <h2>User Information</h2>
          <p>ID: {fetchedUserData.id}</p>
          <p>First Name: {fetchedUserData.first_name}</p>
          <p>Last Name: {fetchedUserData.last_name}</p>
          <p>Username: {fetchedUserData.username}</p>
          <p>Email: {fetchedUserData.email}</p>
        </div>
      )}
    </div>
  );
};

export default UserDashboard;
